    product_id : number;
    name : string;
    price: number;
    thumbnail : string;
}


const Item = ({product_id, name, price, thumbnail}:Props) => {
    const classes = useStyles();
    return (
        <Card className="classes.root">
            <CardMedia className ={classes.media} image={"https://backendapi.turing.com/images/products/"+thumbnail} title ={name}/>
            <CardContent className ="classes.CardContent">
                <div>
                    <Typography className="classes.hee" variant="h5" gutterBottom> 
                    {name}
                    </Typography>
                    <Typography variant="h5" gutterBottom> 
                    {price}
                    </Typography>
                </div>
            </CardContent>
        </Card>
      );
    }
export default Item;
